import React from "react";
import { Container, Row, Col } from "react-bootstrap";

function Footer() {
  return (
    <>
      <Container fluid className="footer-style">
        <Row>
          <Col><p>This responsive weather web app has been designed and developed by Angelo Fantino</p><p>&#9827; 2022 - Angelo Fantino</p></Col>
        </Row>
      </Container>
    </>
  );
}

export default Footer;
